import React from "react";
import posed from "react-pose";

const Item = posed.div({
  on: { opacity: 1, y: 0 },
  off: { opacity: 0, y: 30, transition: { type: "spring" } }
});

const ItemContainer = props => {
  return <Item {...props} className="item" />;
};

export default ItemContainer;
